import React, { useState, useEffect } from 'react';
import axios from 'axios';
import styled from 'styled-components';

const Container = styled.div`
  padding: 20px;
`;

const Title = styled.h1`
  color: #0077b6;
`;

const ReservationList = styled.ul`
  list-style-type: none;
  padding: 0;
`;

const ReservationItem = styled.li`
  background-color: #f0f8ff;
  margin-bottom: 10px;
  padding: 10px;
  border-radius: 5px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
`;

const AdminPanel = () => {
  const [reservations, setReservations] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:4000/api/reservations')
      .then((response) => {
        setReservations(response.data);
      })
      .catch((error) => console.error('Błąd podczas pobierania rezerwacji:', error));
  }, []);

  return (
    <Container>
      <Title>Panel Admina</Title>
      <h2>Wszystkie rezerwacje</h2>
      <ReservationList>
        {reservations.map((reservation) => (
          <ReservationItem key={reservation.id}>
            <p>Sprzęt ID: {reservation.equipmentId}</p>
            <p>Imię: {reservation.firstName}</p>
            <p>Nazwisko: {reservation.lastName}</p>
            <p>Email: {reservation.email}</p>
            <p>Nr telefonu: {reservation.phone}</p>
            <p>Data rozpoczęcia: {reservation.startDate}</p>
            <p>Data zakończenia: {reservation.endDate}</p>
            <p>Kwota końcowa: {reservation.totalPrice} PLN</p>
          </ReservationItem>
        ))}
      </ReservationList>
    </Container>
  );
};

export default AdminPanel;
